Config.db_i18n [17526]  = {zh-cn= [[《荣耀召唤》将于8月7日10点——8月14日(星期三)12:00进行精英测试，每日12点、18点、21点将会不定期进行钻石等福利的发放哦！若期间有遇到游戏问题，可联系玩家群客服进行提交，如有优化建议、问题反馈均有游戏礼包领取哦！]] , zh-hk= [[《榮耀召喚》將於8月7日10點——8月14日(星期三)12:00進行精英測試，每日12點、18點、21點將會不定期進行鑽石等福利的發放哦！若期間有遇到遊戲問題，可聯繫玩家群客服進行提交，如有優化建議、問題回饋均有遊戲禮包領取哦！]] , thai= [[]] , en= [[Call of Glory will be tested for elites from 10:00 on August 7th to 12:00 on August 14th (Wednesday), and diamonds and other benefits will be issued irregularly at 12:00, 18:00, and 21:00 every day! If you encounter game problems during the period, you can contact the customer service team to submit. If you have optimization suggestions and problem feedback, you can get the game package!]] }
