Config.db_i18n [17530]  = {zh-cn= [[1. 未成年人玩家（18周岁以下）在上线进行游戏时，每过一个小时都会收到系统的防沉迷信息提示]] , zh-hk= [[1. 未成年人玩家（18周歲以下）在上線進行遊戲時，每過一個小時都會收到系統的防沉迷資訊提示]] , thai= [[]] , en= [[1. Players below the age of 18 will receive a notification from the fatigue system every hour.]] }
Config.db_i18n [17531]  = {zh-cn= [[2. 未成年人玩家在线游戏累计3小时后将进入“防沉迷”状态，在游戏中的收益将会减半，同时无法正常交接任务]] , zh-hk= [[2. 未成年人玩家線上遊戲累計3小時後將進入“防沉迷”狀態，在遊戲中的收益將會減半，同時無法正常交接任務]] , thai= [[]] , en= [[2. Underage players will trigger the fatigue system when they have played for more than 3 hours cumulatively. Their in-game rewards will be cut by 50%, and they can't normally turn in or accept quests.]] }
Config.db_i18n [17532]  = {zh-cn= [[3. 未成年人玩家在线游戏累计5小时后将进入高度“防沉迷”状态，在游戏中的收益将会为0，同时无法正常交接任务，只有玩家连续离线时间超过5个小时再上线，才会解除防沉迷状态]] , zh-hk= [[3. 未成年人玩家線上遊戲累計5小時後將進入高度“防沉迷”狀態，在遊戲中的收益將會為0，同時無法正常交接任務，只有玩家連續離線時間超過5個小時再上線，才會解除防沉迷狀態]] , thai= [[]] , en= [[3. Underage players will trigger advanced fatigue mechanism after staying online for more than 5 hours and they will receive nothing in the game. The mechanisms will remove when they stay offline for more than 5 hours.]] }
Config.db_i18n [17533]  = {zh-cn= [[具体说明：]] , zh-hk= [[具體說明：]] , thai= [[]] , en= [[Info:]] }
Config.db_i18n [17534]  = {zh-cn= [[1. 离线时间和在线时间并不是只计算单次的持续在线或离线时间，都是连续累计计算的。所以您不能通过频繁上下线或者其他办法来规避“防沉迷游戏规则”，同样也不会因为在累积离线时间时又不小心进入一次游戏而导致离线时间重新开始累积。]] , zh-hk= [[1. 離線時間和線上時間並不是只計算單次的持續線上或離線時間，都是連續累計計算的。所以您不能通過頻繁上下線或者其他辦法來規避“防沉迷遊戲規則”，同樣也不會因為在累積離線時間時又不小心進入一次遊戲而導致離線時間重新開始累積。]] , thai= [[]] , en= [[1. Both offline and online time are calculated cumulatively. So you can't evade the fatigue system by frequently logging in or out, neither should you worry about the re-accumulation of offline time when you unintentionally logged into the game.]] }
Config.db_i18n [17535]  = {zh-cn= [[2. 离线时间和在线时间是根据实际游戏时间和离线时间进行累积。每当累积到3小时的在线时间就会进入”防沉迷”状态，此后不可能再累积到在线时间(因为已经无法进入游戏)。每当累积到5小时的离线时间就会清除之前累积的在线时间或者清除之前的”防沉迷”状态(如果之前已经进入”防沉迷”状态)。]] , zh-hk= [[2. 離線時間和線上時間是根據實際遊戲時間和離線時間進行累積。每當累積到3小時的線上時間就會進入”防沉迷”狀態，此後不可能再累積到線上時間(因為已經無法進入遊戲)。每當累積到5小時的離線時間就會清除之前累積的線上時間或者清除之前的”防沉迷”狀態(如果之前已經進入”防沉迷”狀態)。]] , thai= [[]] , en= [[2. Both offline and online time are cumulated based on the actual time length. Each time when you have been online for 3 hours cumulatively, the fatigue system will activate and no more online time length will be cumulated (since you will be unable to enter the game). Each time when you have been offline for 5 hours cumulatively, the fatigue system will deactivate.]] }
Config.db_i18n [17536]  = {zh-cn= [[3. 离线时间如果超过5小时以上就不再累计。也就是说不能通过1次休息15个小时来实现连续玩9小时的游戏模式。]] , zh-hk= [[3. 離線時間如果超過5小時以上就不再累計。也就是說不能通過1次休息15個小時來實現連續玩9小時的遊戲模式。]] , thai= [[]] , en= [[3. Offline time will stop stacking when it's more than 5 hours It means you can't stay offline for 15 hours for a 9-hour play.]] }
Config.db_i18n [17537]  = {zh-cn= [[4. 离线时间和在线时间完全根据真实发生的时长连续累计，不存在固定的累积周期，也就是说不存在一天中每8个小时为一周期开始重新累积的情况，也不存在每到新的一天开始重新累积的情况。]] , zh-hk= [[4. 離線時間和線上時間完全根據真實發生的時長連續累計，不存在固定的累積週期，也就是說不存在一天中每8個小時為一週期開始重新累積的情況，也不存在每到新的一天開始重新累積的情況。]] , thai= [[]] , en= [[4. Both offline and online time are stacked based on actual time and there is no fixed cumulation period.]] }
Config.db_i18n [17538]  = {zh-cn= [[5. 由于身份证号和真实姓名是标识会员账户所有权的重要依据，今后若有帐号被盗等有关帐号归属权纠纷的问题，都需要提供有效身份证明等依据来帮助找回会员帐号。所以请广大玩家务必按照个人的真实情况进行注册或修改，以免日后带来不必要的麻烦。]] , zh-hk= [[5. 由於身份證號和真實姓名是標識會員帳戶所有權的重要依據，今後若有帳號被盜等有關帳號歸屬權糾紛的問題，都需要提供有效身份證明等依據來幫助找回會員帳號。所以請廣大玩家務必按照個人的真實情況進行註冊或修改，以免日後帶來不必要的麻煩。]] , thai= [[]] , en= [[5. Since the ID number and real name are important for identifying the ownership of the member account, if there are any disputes about the ownership of the account such as account theft in the future, it is necessary to provide valid identity proof and other proof to help retrieve the member account. Therefore, please register or modify according to the actual situation of the individual to avoid unnecessary dispute in the future.]] }
